function v(x, y, z) {
	return new THREE.Vector3(x, y, z);
}
function ifelser(expr, true_return, false_return) {
	if(expr) {return(true_return);} else {return(false_return);}
}

function colMax(data, i) {
	return Math.max.apply(null, data.map(function(v) {return v[i];}));
}
function colMin(data, i) {
	return Math.min.apply(null, data.map(function(v) {return v[i];}));
}
function normalize(data, i, factor) {
	var extent = [colMin(data, i), colMax(data, i)];
	//console.log(extent);
	function norm_single(x) {
		var mid = (extent[1] + extent[0])/2;
		var dist = (extent[1] - extent[0])/2;
		if(dist == 0) {dist = 1;} //in case points lie on plane
		return (x - mid) / dist * factor;
	}
	return data.map(function(v) {return norm_single(v[i]);});
}

function pointMesh(pch, size, color, outline_color) {
	pch = pch.toString();
	//console.log(pch);
	switch(pch) {
		case "1":
			var geometry = new THREE.SphereGeometry(size,12,12);
			var material = new THREE.MeshLambertMaterial({emissive: color, ambient: color});
			return new THREE.Mesh(geometry, material);
		case "2":
			return makePointMeshFromData(tetrahedron, size, color, outline_color, false);
		case "3":
			return makePointMeshFromData(cube, size, color, outline_color, false);
		case "4":
			return makePointMeshFromData(great_stellated_dodecahedron, size, color, outline_color, false);
		case "11":
			return_obj = new THREE.Object3D();
			var geometry = new THREE.SphereGeometry(size,12,12);
			var material = new THREE.MeshLambertMaterial({emissive: color, ambient: color});
			return_obj.add(new THREE.Mesh(geometry, material));
			geometry = new THREE.SphereGeometry(size*1.15,12,12);
			material = new THREE.MeshBasicMaterial({color: outline_color, side: THREE.BackSide});
			return_obj.add(new THREE.Mesh(geometry, material));
			return return_obj;
		case "12":
			return makePointMeshFromData(tetrahedron, size, color, outline_color, true);
		case "13":
			return makePointMeshFromData(cube, size, color, outline_color, true);
		case "14":
			return makePointMeshFromData(great_stellated_dodecahedron, size, color, outline_color, true);
		
		default:
			var geometry = new THREE.SphereGeometry(size,12,12);
			var material = new THREE.MeshLambertMaterial({emissive: color, ambient: color});
			return new THREE.Mesh(geometry, material);
		}
}


function makePointMeshFromData(data, size, color, outline_color, outline_boolean) {
	
	var inherent_size = data.inherent_size; // may want to define later, to get different shapes on the same scale
	var outline_ratio = data.outline_ratio; //radius of outline relative to radius of shape
	var factor = size/inherent_size; //assume shape is centered on local origin
	var radius = size * outline_ratio;
	
	var return_obj = new THREE.Object3D();
	var face_geometry = new THREE.Geometry();
	for (var i = 0; i < data.vertex.length; i++) {
		face_geometry.vertices.push(new THREE.Vector3(data.vertex[i][0] * factor, data.vertex[i][1] * factor, data.vertex[i][2] * factor));
	}
	for (var faceNum = 0; faceNum < data.face.length; faceNum++) {
		for (var i = 0; i < data.face[faceNum].length - 2; i++) {
			face_geometry.faces.push(new THREE.Face3(data.face[faceNum][0], data.face[faceNum][i+1], data.face[faceNum][i+2]));
		}
	}
	face_geometry.computeFaceNormals();
	face_geometry.computeVertexNormals();

	if(outline_boolean) {
		var vertex_geometry = new THREE.Geometry();
		for (var i = 0; i < data.vertex.length; i++) {
			var vertex = data.vertex[i];
			var sphere = new THREE.SphereGeometry(radius, 8, 8);
			sphere.applyMatrix(new THREE.Matrix4().makeTranslation(vertex[0] * factor,vertex[1] * factor,vertex[2] * factor));
			vertex_geometry.merge(sphere);
		}
		
		var edge_geometry = new THREE.Geometry();
		for (var i = 0; i < data.edge.length; i++) {
			var index0 = data.edge[i][0];
			var index1 = data.edge[i][1];
			var tube = cylinderDirGeometry(data.vertex[index0], data.vertex[index1], factor, radius);
			edge_geometry.merge(tube);
		}
		var outline_geometry = new THREE.Geometry();
		outline_geometry.merge(edge_geometry);
		outline_geometry.merge(vertex_geometry);
		var outline_material = new THREE.MeshBasicMaterial({color: outline_color});
		var outline_mesh = new THREE.Mesh(outline_geometry, outline_material);
		return_obj.add(outline_mesh);
	}
	
	var face_material = new THREE.MeshLambertMaterial({emissive: color, ambient: color, side: THREE.DoubleSide});
	var face_mesh = new THREE.Mesh(face_geometry, face_material);
	return_obj.add(face_mesh);
	return return_obj;
}

function cylinderDirGeometry(point1, point2, factor, radius)
{
	var p2 = new THREE.Vector3(point2[0] * factor,point2[1] * factor,point2[2] * factor);
	var p1 = new THREE.Vector3(point1[0] * factor,point1[1] * factor,point1[2] * factor);
	var direction = new THREE.Vector3().subVectors(p2,p1);
	var arrow = new THREE.ArrowHelper(direction.clone().normalize(), point1);
	var edge_geometry = new THREE.CylinderGeometry(radius, radius, direction.length(), 8, 8);
	var tvec = new THREE.Vector3().addVectors( p1, direction.multiplyScalar(0.5));
	edge_geometry.applyMatrix(new THREE.Matrix4().makeRotationFromQuaternion(arrow.quaternion));
	edge_geometry.applyMatrix(new THREE.Matrix4().makeTranslation(tvec.x,tvec.y,tvec.z));
	return edge_geometry;
}


